मेक्सिको सिटी । अमेरिकी राज्य टेक्सासमा मेक्सिकन नौ&amp;ndash;सेनाको चिकित्सा सामाग्री वोकेको विमान दुर्घटना ग्रस्त भए पछि कम्तिमा पाँच जनाको मृत्यु भएको सेनाले जनाएको छ ।

मानवीय अभियानमा रहेको विमानमा आठ जना यात्रुहरु सवार रहेको मेक्सिकोको सेना सचिवालयले एक विज्ञप्ति मार्फत जनाएको &amp;nbsp;छ ।&amp;nbsp;

सुरुवाती समयमा दुर्घटनामा दुई जनाको मृत्यु भएको रिपोर्ट गरिएकोमा हाल मृतकको सङ्ख्या बढेर पाँच जना पुगेको जनाइएको छ भने &amp;nbsp;दुर्घटनाबाट दुई जना यात्रुहरु बाच्न सफल भएको जनाइएको छ । &amp;nbsp;

अमेरिकी तटरक्षकको खोजी प्रयासक...

काठमाडौं । धनगढीमा अन्तर्राष्ट्रिय चेन अन्तरगत पहिलो पाँचतारे होटल सञ्चालक हुने भएको छ ।&amp;nbsp;

आज काठमाडौंमा राष्ट्र बैंकका गभर्नर डा. विश्व पौडेलको उपस्थितिमा क्लब चौलानी लिमिटेड र होलिडे ईन बाई आईएचजी बीच होटल व्यवस्थापन सम्बन्धी सम्झौता भएको हो ।&amp;nbsp;

उक्त सम्झौतामा क्लब चौलानीका अध्यक्ष डा. राजेन्द्र केसी र आईएचजी होटल्स एण्ड रिसोर्टका दक्षिण एशियाका प्रबन्ध निर्देशक सुदीप जैनले हस्ताक्षर गरेका हुन् ।

उक्त कार्यक्रममा सीए दीपक पाण्डेले सञ्चारकर्मीहरूको प्रश्नको उत्तर दिनु भएको थियो ।&amp;nbsp;

