नेकपा एमालेका नवनिर्वाचित सचिव शेरधन राईले पार्टीको नीति, पद्धति र निर्णयविपरीत गतिविधि गर्ने जोसुकैलाई पनि विधान बमोजिम कारबाही गरिने चेतावनी दिएका छन् ।

एमाले कोशी प्रदेश कमिटीले मंगलबार विराटनगरमा आयोजना गरेको पत्रकार सम्मेलनमा बोल्दै सचिव राईले एमाले संस्थागत पद्धतिमा चल्ने पार्टी भएको स्पष्ट पारे ।&amp;nbsp;

उनले पार्टीभित्रै बसेर पार्टीकै हितविपरीत काम गर्ने वा संस्थागत निर्णयलाई चुनौती दिने छुट कसैलाई नभएको चेतावनी दिए ।&amp;nbsp;

