काठमाडौं । सिन्धुलीको कमलामाई नगरपालिका–४, धुराफाँटमा आइतबार अपराह्न साढे ४ बजेतिर ३२ वर्षीया सुशीला घिसिङको पेट्रोल छर्केर आगजनी गरी हत्या गरिएको अवस्थामा शव फेला पर्यो। घरायसी विवादले चुलिएको पारिवारिक द्वन्द्व अन्ततः जघन्य हत्यामा परिणत भएको प्रारम्भिक अनुसन्धानले देखाएको छ।
घटनामा संलग्न भएको आरोपमा मृतककी सासू ५९ वर्षीया मायारानी बमजन र नन्द ३५ वर्षीया मिना बमजनलाई प्रहरीले पक्राउ गरेको छ। जिल्ला प्रहरी कार्यालय सिन्धुलीका एसपी लालध्वज सुवेदीका अनुसार दुवै जनालाई नियन्त्रणमा लिएर थप अनुसन्धान अघि बढाइएको छ।
घटनास्थलबाट पेट्रोलसमेत बरामद गरिएको प्रहरीले जनाएको छ।
मृतकका माइती पक्षले ६५ वर्षीय ससुरा दुर्गामान बमजनविरुद्ध पनि किटानी ...

सरकारका मन्त्रीहरूले नेपाली कांग्रेसको केन्द्रीय कार्यालय सानेपाको अनगुमन गरेका छन् । सरकारले बनाएको उच्च स्तरीय राजनीतिक वार्ता समितिको तर्फबाट उनीहरू त्यहाँ पुगेका &amp;nbsp;हुन् ।&amp;nbsp;

कानून, न्याय तथा संसदीय मामिला मन्त्री अनिल सिन्हा र सञ्चार तथा सूचना प्रविधि मन्त्री जगदीश खरेल राजनीतिक दलको कार्यालय अनुगमन गर्ने क्रममा मंगलबार कांग्रेस पार्टी कार्यालयको अनुमगन गरेका हुन् ।

प्रधानमन्त्री सुशीला कार्कीका प्रमुख राजनीतिक सल्लाहकार अजयभद्र खनाल पनि अनुगमनमा सहभागी छन् । उनीहरूले &amp;nbsp;कांग्रेसका उपसभापति धनराज गुरुङ, सहमहा...

काठमाडौं । राष्ट्रिय स्वतन्त्र पार्टी (रास्वपा)का सभापति रवि लामिछाने आगामी फागुन २१ मा हुने भनिएको निर्वाचन आफ्नो पक्षमा पार्न नयाँ कुटनीति अपनाएका छन् ।&amp;nbsp;

कमलपोखरीस्थित रास्वपाका एक नेताको घरमा सोमबार बेलुकी भएको भेटमा लामिछानेले काठमाडौं महानगरपालिकाका मेयर बालेन शाहलाई अबको चुनावपछिको प्रधानमन्त्रीको रुपमा अघि सारेका छन् ।&amp;nbsp;

बालेनलाई आफ्नो राजनीतिक अभियानमा सामेल गराउन उनले सशक्त प्रस्ताव अघि सारेका हुन् । बालेन र रवि अहिले जनतामा निकै लोकप्रिय युवा नेतामा पर्छन । रविको प्रस्तावमा बालेन पनि सकारात्मक ब...

काठमाडौँ । नेपाल क्रिकेट संघ (क्यान) ले नेपालमा आयोजना हुने आइसीसी महिला टी&amp;ndash;२० विश्वकप ग्लोबल छनोटको खेल तालिका सार्वजनिक गरेको छ । उक्त प्रतियोगितामा विभिन्न १० राष्ट्रको सहभागिता रहेको छ ।&amp;nbsp;

क्यानले आज सार्वजनिक गरेको खेल तालिकाअनुसार नेपाल समूह &amp;lsquo;बी&amp;rsquo; मा परेको छ । नेपाली महिला क्रिकेट टोली पहिलोपटक विश्वकप एसिया छनोट पार गरेर ग्लोबल छनोटमा पुगेको हो । नेपालको समूहमा स्कटल्यान्ड, थाइल्यान्ड, नेदरल्यान्ड्स र जिम्बावे रहेका छन् ।

