काठमाडौं । मेरोमाइक्रोफाइनान्स लघुवित्त वित्तीय संस्था लिमिटेडले गत आवको नाफाबाट ५ प्रतिशत लाभांश घोषणा गरेको छ ।&amp;nbsp;

सञ्चालक समितिको बैठकले हाल कायम चुक्ता पूँजीको ४.७५ प्रतिशत बोनश शेयर र कर प्रयोजनका लागि ०.२५ प्रतिशत नगद लाभांश प्रस्ताव गर्ने निर्णय गरेको हो । राष्ट्र बैंकबाट स्वीकृत भई आगामी वार्षिक साधारण सभाले पारित गरेपश्चात शेयरधनीहरुले लाभांश पाउने छन् ।&amp;nbsp;

यता, एनएलजी इन्स्योरेन्स लिमिटेडले गत आवको नाफाबाट ७ प्रतिशत लाभांश घोषणा गरेको छ । सञ्चालक समितिले बैठकले ४ प्रतिशत बोनस शेयर र ३ प्रतिशत नगद ल...

काठमाडौं । मंगलबार सुनको मूल्य ह्वात्तै बढेको छ । आज सुन मूल्य प्रतितोला ५ हजार ५ सय र चाँदीको मूल्य प्रतितोला २० रुपियाँ बढेको हो । सुनचाँदी दुबैको मूल्य बढेर आज नयाँ रेकर्ड कायम भएको छ ।&amp;nbsp;

नेपाल सुनचाँदी व्यवसायी महासंघका अनुसार आज सुन प्रतितोला २ लाख ६७ हजार २ सय रुपियाँमा कारोबार भइरहेको छ ।&amp;nbsp;

त्यस्तै आज चाँदी प्रतितोला ४ हजार २ सय ५५ रुपियाँमा कारोबार भइरहेको छ ।&amp;nbsp;

अन्तर्राष्ट्रिय बजारमा सुनचाँदीको मूल्य निरन्तर बढिरहेकाले त्यसैको प्रभाव नेपाली बजारमा पनि परेको महासंघले जनाएको छ ।&amp;nbsp;
